    "cortana_in_context_feedback_button_title": "Proporcione comentarios para ayudar a mejorar Cortana en Teams",
    "cortana_long_consent_bullet_point_1": "Aunque respetaremos su contenido y los modelos que creamos se han diseñado para que funcionen genéricamente, evite enviar información confidencial o personal, como direcciones de correo electrónico, números de la seguridad social y similares.",
    "cortana_long_consent_bullet_point_2": "Cualquier comando que extraigamos se almacenará de forma segura, con acceso limitado a los equipos de comprensión de voz e idioma. Los registros de audio se conservarán durante un máximo de 18 meses y se eliminarán.",
