    "cortana_long_consent_heading": "Hola participante:",
    "cortana_long_consent_important": "Información importante",
    "cortana_long_consent_privacy": "Su privacidad es importante para nosotros",
    "cortana_long_consent_sub": "Esta es una información importante que debería conocer:",
    "cortana_long_consent_term_of_use_bullet_point2": "Información personal confidencial. Contenido relacionado con datos confidenciales como citas médicas o de cuidado de la salud, comunicaciones privilegiadas por el cliente de abogados u otro tipo de información relacionada con RR. HH. o el personal, como evaluaciones de empleados, contratación, etc. Si duda, no proporcione el contenido.",
    "cortana_long_consent_terms_of_use": "Condiciones de Uso",
    "cortana_long_consent_terms_of_use_bullet_point1": "Información confidencial de Microsoft. Contenido relacionado con las transacciones empresariales de Microsoft (por ejemplo, adquisiciones u otras transacciones relacionadas con desarrollo corporativo, desarrollo empresarial o finanzas.), con la excepción de la información de viajes, como recibos, pliegos y similares.",
    "cortana_long_consent_terms_of_use_bullet_point2": "Contenido de Europa. No contribuya con ningún contenido que provenga de compañeros en Europa (por ejemplo, no envíe a la herramienta un correo electrónico que haya recibido de un compañero en Europa).",
    "cortana_long_consent_terms_of_use_bullet_point3": "Información personal confidencial. Contenido relacionado con datos confidenciales como citas médicas o de cuidado de la salud, comunicaciones privilegiadas por el cliente de abogados u otro tipo de información relacionada con RR. HH. o el personal, como evaluaciones de empleados, contratación, etc.  Si duda, no envíe el contenido.",
    "cortana_long_consent_terms_of_use_bullet_point4": "Contraseñas. Contenido que contiene contraseñas.",
    "cortana_long_consent_terms_of_use_bullet_point5": "Información financiera. Contenido que contiene información de tarjeta de crédito o de banco, excepto los últimos cuatro dígitos de una tarjeta de crédito o de una cuenta bancaria.",
    "cortana_long_consent_terms_of_use_bullet_point6": "Proyectos de Tented. Contenido relacionado con proyectos de Tented.",
    "cortana_long_consent_terms_of_use_head": "Al usar esta característica de Teams, acepta los siguientes términos de uso. Este programa recopila datos de voz para su uso con el fin de mejorar el reconocimiento de voz y la comprensión de lenguaje para la experiencia de Teams. Los datos de voz se usarán para entrenar y validar nuestros modelos. El contenido y los metadatos de los datos de voz se verán con un conjunto limitado de empleados y proveedores de Microsoft. Es responsable de ser selectivo en cuanto a su interacción con esta característica en Teams y evitar el envío de información que no quiera que se revele a los miembros del equipo que trabajan en estas características. NO se deben proporcionar las siguientes categorías de contenido:",
    "cortana_long_consent_text": "Tenga en cuenta que si acepta usar esta característica de Teams, usaremos sus datos de voz para mejorar la experiencia de voz de Teams. El desarrollo y la mejora de estos modelos nos ayudarán a crear nuevas y mejores características para que los usuarios puedan implementar. Tenga en cuenta que su participación en este programa es completamente voluntaria, por lo que no le penalizamos por no participar. No se realizará un seguimiento de quién participe o no. ¡Gracias por hacer que este programa sea genial!",
